var isEdit = false;
var canvas, context;
var modalImg = new Image();
var frameImg = new Image();
var isDraggable = false;
var facemashModel = null;
var diffY = 0;

var StandardEyeLine = 0;
var currentX = 0;
var currentY = 0;

var frameWidth = 0;
var frameHeight = 0;
let faceEyesStartToEnd = [124,168,353,197];

jQuery(document).ready(function(){
  canvas = document.getElementById("gvtryon_admin_tryon_canvas");
  console.log(canvas);
  if(typeof canvas != 'undefined' && canvas !== '' && canvas !== null){
    setfacemashModel();
      context = canvas.getContext("2d");
      modalImg.src = "data:image/jpeg;base64,"

      context.drawImage(modalImg, 0, 0);

      // currentX = canvas.width/2;
      // currentY = canvas.height/2;
      jQuery('#frameMiddelPointX').val(currentX);
      jQuery('#frameMiddelPointY').val(currentY);
      diffY = jQuery('#diffY').val();
      frameImg.onload = function() {
        _Go();
      };
     
      frameImg.src=jQuery('#gvtryon_frame_image').val();

      frameWidth = frameImg.width;//jQuery('#gvtryon_frame_width').val();
      frameHeight = frameImg.height;
      jQuery('.gvtryon_edit_virtual').attr('data-isEdit',isEdit);
      jQuery('#gvtryon_done_changes').on('click',function(){
      	callOnDoneChanges();
      })
      jQuery('#gvtryon_edit_changes').on('click',function() {
      	callOnEditButton();
      });
      jQuery('#gvtryon_edit_changes').click();
    }
    jQuery('#gvtryon_frame_width,#gvtryon_standard_face_width,#gvtryon_frame_image').on('change',function(){
        jQuery('#gvtryon_reload_message').show();
    })
});

async function setfacemashModel() {
  facemashModel = await facemesh.load();
}

function _Go() {
	if(isEdit == true){
		_MouseEvents();
	    _ResetCanvas();
	    _DrawImage();
	  	detectFaces();
	}else{
		if(currentX == 0 && currentY == 0){
			_ResetCanvas();
		    _DrawImage();
		  	detectFaces();
		}
	  _resetEvents();
	}
}
function _ResetCanvas() {
  context.fillStyle = '#fff';
  context.fillRect(0,0, canvas.width, canvas.height);
}
function _resetEvents() {
  canvas.onmousedown = function(e) {
  };
  canvas.onmousemove = function(e) {
  };
  canvas.onmouseup = function(e) {
  };
  canvas.onmouseout = function(e) {
  };
}
function _MouseEvents() {
  canvas.onmousedown = function(e) {
    var offset = jQuery(canvas).offset();
    var mouseX = e.pageX - offset.left;
    var mouseY = e.pageY - offset.top;

    if (mouseX >= (currentX - frameImg.width) &&
        mouseX <= (currentX + frameImg.width) &&
        mouseY >= (currentY - frameImg.height) &&
        mouseY <= (currentY + frameImg.height)) {
      isDraggable = true;
      //currentX = mouseX;
      //currentY = mouseY;
    }
  };
  canvas.onmousemove = function(e) {
    if (isDraggable) {
    	var offset = jQuery(canvas).offset();
		// currentX = e.pageX - offset.left;
		currentY = e.pageY - offset.top;
		// jQuery('#frameMiddelPointX').val(currentX);
		jQuery('#frameMiddelPointY').val(currentY);
		jQuery('#diffY').val(currentY - jQuery('#StandardEyeLine').val());
    }
    _ResetCanvas();
    _DrawImage();
  };
  canvas.onmouseup = function(e) {
    isDraggable = false;
  };
  canvas.onmouseout = function(e) {
    isDraggable = false;
  };
}
function _DrawImage() {
	let Realsizewidth = jQuery('#frameWidthO').val();
	let RealsizeHeight = jQuery('#frameHeightO').val();
	let frameMiddelPointX = jQuery('#frameMiddelPointX').val();
	let frameMiddelPointY = jQuery('#frameMiddelPointY').val();

    context.drawImage(modalImg, 0, 0, canvas.width, canvas.height);
  	// horizontal line
  	context.beginPath(); 
	context.moveTo(0,StandardEyeLine);
	context.lineTo(canvas.width,StandardEyeLine);
	context.lineWidth = 1;
	context.stroke();
	// right verticle line
	context.beginPath(); 
	context.moveTo(parseInt(frameMiddelPointX) + parseInt(Realsizewidth/2), 0);
	context.lineTo(parseInt(frameMiddelPointX) + parseInt(Realsizewidth/2), canvas.height);
	context.lineWidth = 1;
	context.stroke();
	// left verticle line
	context.beginPath(); 
	context.moveTo(frameMiddelPointX - (Realsizewidth /2),0);
	context.lineTo(frameMiddelPointX - (Realsizewidth /2),canvas.height);
	context.lineWidth = 1;
	context.stroke();
	
  	context.drawImage(frameImg,frameMiddelPointX - (Realsizewidth /2), frameMiddelPointY , 
  		Realsizewidth, RealsizeHeight);
}

function convertMMtoPX(val) {
	return (val * 3.7795275591);
}
function convertPXtoMM(val) {
	return (val / 3.7795275591);
}

async function detectFaces(){
	jQuery('.gvtryon_edit_virtual').addClass('loading');
    if(facemashModel === null || facemashModel === undefined){
      facemashModel = await facemesh.load();
    }
    return await facemashModel.estimateFaces(canvas).then(function(predictions){ 
        onEstimateFacesResult(canvas,predictions)
    });
}

function getDistance(xA, yA, xB, yB) { 
    var xDiff = xA - xB; 
    var yDiff = yA - yB; 
    return Math.sqrt(xDiff * xDiff + yDiff * yDiff);
}

function getAngle(xA, yA, xB, yB){
    return Math.atan2( yB-yA, xB-xA ) * 180 / Math.PI;
}

function getCoordinate (inputElement,canvasElement,x,y) {
    let ratio,resizeX, resizeY,leftAdjustment;
    ratio = canvasElement.clientHeight/inputElement.height;
    resizeX = x*ratio;
    resizeY = y*ratio;
   
    return [resizeX, resizeY];
}

function onEstimateFacesResult(inputElement,predictions){
    jQuery('.gvtryon_edit_virtual').removeClass('loading');
    let canvasElement = inputElement;
    if (predictions.length > 0) {
        for (let x = 0; x < predictions.length; x++) {
            const keypoints = predictions[x].scaledMesh;  //468 key points of face;
            let faceLeftPoint = getCoordinate(inputElement,canvasElement,keypoints[faceEyesStartToEnd[0]][0],keypoints[faceEyesStartToEnd[0]][1]);
            let faceMiddlePoint = getCoordinate(inputElement,canvasElement,keypoints[faceEyesStartToEnd[1]][0],keypoints[faceEyesStartToEnd[1]][1]);
            let faceRightPoint = getCoordinate(inputElement,canvasElement,keypoints[faceEyesStartToEnd[2]][0],keypoints[faceEyesStartToEnd[2]][1]);
            let faceMiddleBottomPoint = getCoordinate(inputElement,canvasElement,keypoints[faceEyesStartToEnd[3]][0],keypoints[faceEyesStartToEnd[3]][1]);
            
            let fframeLeft = faceLeftPoint[0];
            let fframeLeftTop = faceLeftPoint[1];

            let fframeMiddleTop = faceMiddlePoint[1];
            let fframeMiddleLeft = faceMiddlePoint[0];

            let fframeRight = faceRightPoint[0];
            let fframeRightTop = faceRightPoint[1];

            let ffacewidth =  getDistance( fframeLeft, fframeLeftTop, fframeRight, fframeRightTop);
            let angle = getAngle(fframeLeft, fframeLeftTop, fframeRight, fframeRightTop);
            
            let appendtoOverlayid = '#gvtryon_admin_tryon_modal';
            let standardFrameSizeMM = jQuery('#gvtryon_frame_width').val();
            let standardFaceSizeMM = jQuery('#gvtryon_standard_face_width').val();
            let FrameWidthInMM = convertPXtoMM(ffacewidth);

            let SFS = standardFrameSizeMM?standardFrameSizeMM:0,//80,
                SFaceS = standardFaceSizeMM?standardFaceSizeMM:120,//150,
                CFaceS = FrameWidthInMM?FrameWidthInMM:0,//100,
                CFS = (SFS * CFaceS) / SFaceS;
                console.log('face',SFS,SFaceS,CFaceS,CFS);
            let currentFrameSizePX = CFS ? convertMMtoPX(CFS) : frameWidth;
            jQuery(frameImg).appendTo(jQuery(appendtoOverlayid));
            jQuery(frameImg).css({
                top: 0,//(parseInt(fframeMiddleTop) + parseInt(diffY)), 
                left: 0,//fframeMiddleLeft, 
                // right: fframeRight,
                width: currentFrameSizePX,
                // height: fframeElement.height,
                'transform-origin': 'center center',
                // transform: 'translate(-50%, -50%) rotate('+angle+'deg)',
                position:'absolute',
                zIndex: 55,
            });
            jQuery('#frameWidthO').val(currentFrameSizePX);
			jQuery('#frameHeightO').val(jQuery(frameImg).height());
			currentX = fframeMiddleLeft;
			currentY = diffY? (parseInt(fframeMiddleTop) + parseInt(diffY)): fframeMiddleTop;
			StandardEyeLine = fframeMiddleTop;
			jQuery('#StandardEyeLine').val(StandardEyeLine);
			jQuery('#frameMiddelPointX').val(currentX);
			jQuery('#frameMiddelPointY').val(currentY);
            jQuery(appendtoOverlayid).show();
            _DrawImage();
        }
    }
}

function callOnDoneChanges(){
	isEdit = false;
	jQuery('.gvtryon_edit_virtual').attr('data-isEdit',isEdit);
	_Go();
}

function callOnEditButton() {
	isEdit = true;
	jQuery('.gvtryon_edit_virtual').attr('data-isEdit',isEdit);
	_Go();
}